import React from "react"
import styled from "styled-components"
import { Menu as MenuIcon } from "@material-ui/icons"

function Header() {
    return (
        <div>
            <Container>
                <a>
                    <img
                        className="logo"
                        src="/images/logo-white.png"
                        alt="logo"
                    ></img>
                </a>
                <div>
                    <Menu>
                        <a href="#">Home</a>
                        <a href="#">Login</a>
                        <a href="#">Cadastrar-se</a>
                    </Menu>
                    <HamburguerMenu></HamburguerMenu>
                </div>
            </Container>
        </div>
    )
}

export default Header

const Container = styled.div`
    min-height: 60px;
    position: fixed;
    background-color: black;
    display: flex;
    align-items: center;
    padding: 0 20px;
    justify-content: space-between;
    top: 0;
    left: 0;
    right: 0;
    opacity: 0.7;

    img {
        height: 50px;
    }
    div{
        display: flex;
    }
`
const Menu = styled.nav`
    display: flex;
    align-items: center;
    justify-content:center
    flex:1;
    font-weight: 600;

    a{
        padding: 0px 15px;
    }

    // @media and screen
`

const HamburguerMenu = styled(MenuIcon)`
    color: white;
    margin-left:20px;
`
